import React from "react";
import "../styles/Navbar.css";

// By importing the Navbar.css file, it is added to the DOM whenever this component loads
var divStyle = {
  color: "green",
}

function Navbar() {
  return (
    <nav className="navbar" style={divStyle}>
      <a href="/">Welcome</a>
    </nav>
  );
}

export default Navbar;
